            <img src="assets/img/brand/Logo.png" class="w-[150px] pt-1" />
          </a>
        </div>
        <div class=" h-[80%] mt-4">
           <router-outlet></router-outlet>
        </div>
      </div>
    </div>
    <div class="w-[50%] hidden lg:block bg-brand650 rounded-r-[50px] bg-cover bg-[url('assets/img/Frame.png')]"></div>
  </div>

</div>
